var title_f6_50_6948="Changes calcium sensitivity";
var content_f6_50_6948=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F63030&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F63030&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 487px\">",
"   <div class=\"ttl\">",
"    Effects of interventions on the calcium sensitivity of the contractile apparatus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 467px; height: 362px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Panel A summarizes different interventions and their effects on myofilament calcium sensitivity. Panel B show the effects of these interventions on the intracellular calcium transient. Note that drugs that decrease myofilament calcium sensitivity increase the amplitude of the calcium transient relative to drugs that do not change or increase myofilament calcium sensitivity. Panel C shows the effects of these agents on the force (F",
"    <sub>",
"     max",
"    </sub>",
"    ) versus calcium concentration ([Ca",
"    <sup>",
"     2+",
"    </sup>",
"    ]",
"    <sub>",
"     o",
"    </sub>",
"    ) relationship of skinned or hyperpermeabilized fibers. The interventions that increase myofilament sensitivity to calcium have the potential to cause or exacerbate diastolic dysfunction; conversely, agents which decrease myofilament sensitivity to calcium have a potential lusitropic effect.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
