var title_f6_50_6956="Pseudoallergen free diet";
var content_f6_50_6956=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F68566&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F68566&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=9\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Pseudoallergen free diet - prohibited foodstuffs",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Foodstuff",
"      </td>",
"      <td class=\"subtitle1\">",
"       Comments",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Additives",
"      </td>",
"      <td>",
"       E100-E1518, preservatives or artificial colors, gelling agents, thickening matter, humectant, emulsifiers, flavor potentiators, antioxidants, separating agents, sweeteners, baking agents, modified starches, foaming agents, stabilizers, flavoring agents",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Spices and herbs",
"      </td>",
"      <td>",
"       (Salt and chives allowed) Avoid all others",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Egg products",
"      </td>",
"      <td>",
"       Eggs, pasta made with eggs, cake, biscuits, mayonnaise",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Meat and seafood",
"      </td>",
"      <td>",
"       Smoked meats, seafood",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Vegetables",
"      </td>",
"      <td>",
"       Tomatoes, artichokes, peas, mushrooms, spinach, rhubarb, olives, sweet peppers",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Fruit",
"      </td>",
"      <td>",
"       Fresh fruits, dried fruits, and fruit juices",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Breads",
"      </td>",
"      <td>",
"       Breads with additional grains, herbs, or other such added ingredients. Packaged bread is preferrable to bakery breads, because the ingredients are listed on the label.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Miscellaneous, candies",
"      </td>",
"      <td>",
"       Alcohol, herbal teas, margarine, sesame, potato chips, chewing gum, candy",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    A pseudoallergen free diet consists of only fresh foods that are NOT listed above, or deep-frozen versions of these foods without any additives. All preserved and processed foods should be avoided. Chemical and common names for additives listed by E number above may be found online at www.food.gov.uk/safereating/chemsafe/additivesbranch/enumberlist.",
"    <br>",
"     The author of this review and the editors of UpToDate do not routinely recommend this diet to patients with chronic urticaria, for the reasons discussed in the text. However, there may be patients who are interested in this information.",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"      Adapted from: Magerl, M, Pisarevskaja, D, Scheufele, R, et al. Effects of a pseudoallergen free diet on chronic spontaneous urticaria: a prospective trial. Allergy 2010; 65:78.",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f6_50_6956=[""].join("\n");
var outline_f6_50_6956=null;
var title_f6_50_6957="Etiology of macrocephaly";
var content_f6_50_6957=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F65812&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F65812&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Selected causes of macrocephaly",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\" class=\"container\">",
"     <tbody>",
"      <tr>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Increased brain (megalencephaly)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle2_single\">",
"            Anatomic",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Familial megalencephaly",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Neurocutaneous disorders (eg, neurofibromatosis, tuberous scleorsis, linear sebaceous nevus syndrome, Sturge-Weber syndrome, Klippel-Trenaunay-Weber syndrome, nevoid basal call carcinoma syndrome [Gorlin syndrome])",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Autism spectrum disorder",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Achondroplasia",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Cerebral gigantism (Sotos syndrome)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Fragile X syndrome",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            PTEN hamartoma syndromes (eg, Cowden syndrome, Bannayan-Riley-Ruvalcaba)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle2_single\">",
"            Metabolic",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Leukodystrophies (eg, Alexander, Canavan, megalencephalic leukoencephalopathy)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"indent1\">",
"            Lysosomal storage disorders (eg, Tay-Sachs, mucopolysaccharidosis, gangliosidosis)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Increased cerebrospinal fluid",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Hydrocephalus*",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Benign enlargement of the subarachnoid space",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Hydranencephaly",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Choroid plexus papilloma",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"       <td class=\"container\">",
"        <table cellspacing=\"0\">",
"         <tbody>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Increased blood",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Hemorrhage (intraventricular, subdural, epidural, subarachnoid)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Arteriovenous malformation",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Increased bone",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Bone marrow expansion (eg, thalassemia major)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Primary bone disorders (eg, skeletal and cranial dysplasias such as achondroplasia, osteogenesis imperfecta, cleidocranial dysostosis, metaphyseal dysplasia, osteopetrosis, hyperphosphatasia)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Increased intracranial pressure",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Idiopathic (pseudotumor cerebri)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Infection or inflammation (eg, meningitis)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Toxins (eg, lead)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Metabolic abnormalities (eg, vitamin A deficiency or excess, galactosemia)",
"           </td>",
"          </tr>",
"          <tr>",
"           <td class=\"subtitle1_single\">",
"            Mass lesions",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Intracranial cyst",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Intracranial tumor",
"           </td>",
"          </tr>",
"          <tr>",
"           <td>",
"            Intracranial abscess",
"           </td>",
"          </tr>",
"         </tbody>",
"        </table>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     *&nbsp;Please see the topic review on hydrocephalus.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
